import React from "react";


function CatalougUpperpart(props){
    return(
        <>
         <div className="upper_part">
          <div className="catalaug_name"> {props.CatalougUpperpart_catagory_name}</div>
          <button className="view_all" autoFocus >View All <b><span  className="iconify" data-icon="mdi:chevron-right" data-inline="false" id="arrow"></span></b> </button>  
          </div>
         
        </>
    );
}

export default CatalougUpperpart;
